import AddData from "./AddData";

const PostFetch = () => {
  async function addDataHandler(anything) {
    const response = await fetch(
      "https://react-exercise-4bddf-default-rtdb.firebaseio.com/objects/first.json",
      {
        method: "POST",
        body: JSON.stringify(anything),
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    const data = await response.json();
    console.log(data);
  }
  return (
    <div>
      <section>
        <AddData onAddData={addDataHandler} />
      </section>
    </div>
  );
};

export default PostFetch;
